import React, { useState } from "react";
import { HashLink as Link } from "react-router-hash-link";
import { FiMenu } from "react-icons/fi";

const navLinks = [
  { to: "#", text: "Home" },
  { to: "#access", text: "About Us" },
  { to: "#solutions", text: "Solutions" },
  { to: "#images", text: "images/logo 1.png", isImage: true },
  { to: "#blogs", text: "Blogs" },
  { to: "#trails", text: "Trails" },
  { to: "#contact", text: "Contact Us" },
];

const Header = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <div className="p-6 fixed w-full z-20 bg-cover bg-no-repeat bg-center lg:w-full md:w-full">
      <div className="container mx-auto flex justify-between items-center">
        <div className="lg:hidden md:hidden sm:hidden flex items-center">
          <img src="images/logo 1.png" alt="logo" className="w-24 sm:w-32" />
        </div>
        <div className="lg:flex md:flex sm:flex hidden gap-16 text-white">
          {navLinks.map((link, index) => (
            <Link key={index} to={link.to} smooth>
              {link.isImage ? (
                <img src={link.text} alt="logo" className="h-8 w-auto" />
              ) : (
                <span className="text-white">{link.text}</span>
              )}
            </Link>
          ))}
        </div>
        <div className="lg:hidden md:hidden sm:hidden flex items-center">
          <button onClick={toggleDropdown} className="text-white">
            <FiMenu className="text-2xl" />
          </button>
        </div>
      </div>

      {isDropdownOpen && (
        <div className="lg:hidden md:hidden sm:hidden fixed right-4 top-16 bg-[#392B85] z-30 flex flex-col gap-4 text-center w-48">
          {navLinks.map((link, index) => (
            <Link
              key={index}
              to={link.to}
              smooth
              onClick={toggleDropdown}
              className="text-white hover:text-gray-300"
            >
              {link.isImage ? (
                <img
                  src={link.text}
                  alt="logo"
                  className="h-10 w-auto mx-auto"
                />
              ) : (
                <span>{link.text}</span>
              )}
            </Link>
          ))}
        </div>
      )}
    </div>
  );
};

export default Header;
